description:
A weekly podcast where two sisters from different generations share their unique perspectives and experiences on topics related to mental and physical health. 
Follow us on IG @2sisters2planets
@gisellearcaute

If you're someone who has been going to the gym but seeing little in the way of results, or if you're a personal trainer or coach who wants to learn more to apply with your clients, then you are in the right place.

We cover everything from nutrition to biomechanics so that you have all of the information you and your clients need to level up your training, nutrition and achieve your dream physique!

Hosted by Physique Factory coaches Conor Moran and James Tildsley.

Check us out on Instagram for more free content!

@physique_factory_coaching 
@cm_physiquefactory
@jt_physiquefactory

Join us and occasional guests' to chat about our perspectives on health, fitness, mindset, and all things wellness. Get ready for our authentic and unfiltered opinions where we chat about our honest experiences, navigating our fitness journeys and passions. Helping you to create habits that will allow you to level up and become the best version of yourself. Follow along for some giggles, growth, and especially gains.

We can't wait to have you as part of this community.

Lots of love, 
Sarz and Ez.
